const BCaMain = (props) => {
  return <section {...props}>
  <header>
    <h2>PlayCO</h2>
    <p>플레이리스트를 멀리서, 다 같이</p>
  </header>

  <PHButton onClick={() => navigate(-1)} variant='outline-success' size='medium'>뒤로 가기</PHButton>
  <PHButton onClick={() => navigate('/')} variant='success' size='medium'>홈으로 가기</PHButton>
</section>;
}

export { BCaMain };
